<div class="c230_47"> 
<div id="v230.47.1"><span class="H5329 s">To the chief Musician</span><span class="H4210 s">, A Psalm</span><span class="H1121 s"> for the sons</span><span class="H7141 s"> of Korah</span><span class="H8628 s">. O clap</span><span class="H3709 s"> your hands</span><span class="H5971 s">, all ye people</span><span class="H7321 s">; shout</span><span class="H430 s"> unto God</span><span class="H6963 s"> with the voice</span><span class="H7440 s"> of triumph</span>. <span class="notes">Notes by the 1611 King James Bible Translators: (for: or, of)</span></div> 
<div id="v230.47.2"><span class="H3068 s">For the LORD</span><span class="H5945 s"> most high</span><span class="H3372 s"> <i>is</i> terrible</span><span class="H1419 s">; <i>he is</i> a great</span><span class="H4428 s"> King</span><span class="H776 s"> over all the earth</span>.</div> 
<div id="v230.47.3"><span class="H1696 s">He shall subdue</span><span class="H5971 s"> the people</span><span class="H3816 s"> under us, and the nations</span><span class="H7272 s"> under our feet</span>.</div> 
<div id="v230.47.4"><span class="H977 s">He shall choose</span><span class="H5159 s"> our inheritance</span><span class="H1347 s"> for us, the excellency</span><span class="H3290 s"> of Jacob</span><span class="H157 s"> whom he loved</span><span class="H5542 s">. Selah</span>.</div> 
<div id="v230.47.5"><span class="H430 s">God</span><span class="H5927 s"> is gone up</span><span class="H8643 s"> with a shout</span><span class="H3068 s">, the LORD</span><span class="H6963 s"> with the sound</span><span class="H7782 s"> of a trumpet</span>.</div> 
<div id="v230.47.6"><span class="H2167 s">Sing praises</span><span class="H430 s"> to God</span><span class="H2167 s">, sing praises</span><span class="H2167 s">: sing praises</span><span class="H4428 s"> unto our King</span><span class="H2167 s">, sing praises</span>.</div> 
<div id="v230.47.7"><span class="H430 s">For God</span><span class="H4428 s"> <i>is</i> the King</span><span class="H776 s"> of all the earth</span><span class="H2167 s">: sing ye praises</span><span class="H7919 s"> with understanding</span>. <span class="notes">Notes by the 1611 King James Bible Translators: (with: or, every one that hath)</span></div> 
<div id="v230.47.8"><span class="H430 s">God</span><span class="H4427 s"> reigneth</span><span class="H1471 s"> over the heathen</span><span class="H430 s">: God</span><span class="H3427 s"> sitteth</span><span class="H3678 s"> upon the throne</span><span class="H6944 s"> of his holiness</span>.</div> 
<div id="v230.47.9"><span class="H5081 s">The princes</span><span class="H5971 s"> of the people</span><span class="H622 s"> are gathered together</span><span class="H5971 s">, <i>even</i> the people</span><span class="H430 s"> of the God</span><span class="H85 s"> of Abraham</span><span class="H4043 s">: for the shields</span><span class="H776 s"> of the earth</span><span class="H430 s"> <i>belong</i> unto God</span><span class="H3966 s">: he is greatly</span><span class="H5927 s"> exalted</span>. <span class="notes">Notes by the 1611 King James Bible Translators: (princesâ€¦: or, voluntary of the people are gathered unto the people of the God of Abraham)</span></div></div>

